const Navbar = () => {
    return(   
      <div>
        <div className=" bg-mybgcolor w-screen h-screen items-center">
          <div className="bg-mycolor w-3.5 h-14 items-center">
            <h1 flex text-center>
              Halo
            </h1>
          </div>
        </div>
      </div>
    );
}


export default Navbar;
